pragma solidity ^0.8.0;

contract VehicleRegistration {
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    struct User {
        address userAddress;
        string username;
        bytes32 passwordHash; // Store hashed passwords
    }

    struct RegistrationData {
        uint registerId;
        address ownerAddress; // Store owner's address
        string vehicleNo;
        string vehicleType;
        string vehicleModel;
        string vehicleCompany;
        string vehicleColor;
        bool approved;
        string documentHash1;
        string documentHash2;
        string imageHash;
    }

    mapping(address => User) public users;
    mapping(string => RegistrationData) public vehicleRegistry; // Mapping by vehicleNo
    uint public registrationCount = 0;

    // Events for tracking actions
    event UserCreated(address indexed userAddress, string username);
    event VehicleRegistered(address indexed owner, string vehicleNo);
    event OwnershipTransferred(string vehicleNo, address indexed oldOwner, address indexed newOwner);
    event RegistrationApproved(string vehicleNo);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only contract owner can perform this action");
        _;
    }

    modifier onlyVehicleOwner(string memory _vehicleNo) {
        require(vehicleRegistry[_vehicleNo].ownerAddress == msg.sender, "You are not the vehicle owner");
        _;
    }

    function createUser(string memory _username, bytes32 _passwordHash) public {
        require(users[msg.sender].userAddress == address(0), "User already exists");
        users[msg.sender] = User(msg.sender, _username, _passwordHash);
        emit UserCreated(msg.sender, _username);
    }

    function registerVehicle(
        string memory _vehicleNo,
        string memory _vehicleType,
        string memory _vehicleModel,
        string memory _vehicleCompany,
        string memory _vehicleColor,
        string memory _documentHash1,
        string memory _documentHash2,
        string memory _imageHash
    ) public {
        require(vehicleRegistry[_vehicleNo].ownerAddress == address(0), "Vehicle already registered");
        registrationCount++;
        vehicleRegistry[_vehicleNo] = RegistrationData(
            registrationCount,
            msg.sender,
            _vehicleNo,
            _vehicleType,
            _vehicleModel,
            _vehicleCompany,
            _vehicleColor,
            false,
            _documentHash1,
            _documentHash2,
            _imageHash
        );
        emit VehicleRegistered(msg.sender, _vehicleNo);
    }

    function approveRegistration(string memory _vehicleNo) public onlyOwner {
        require(vehicleRegistry[_vehicleNo].ownerAddress != address(0), "Vehicle not found");
        require(!vehicleRegistry[_vehicleNo].approved, "Already approved");
        vehicleRegistry[_vehicleNo].approved = true;
        emit RegistrationApproved(_vehicleNo);
    }

    function transferOwnership(string memory _vehicleNo, address _newOwner) public onlyVehicleOwner(_vehicleNo) {
        require(users[_newOwner].userAddress != address(0), "New owner must be a registered user");
        address oldOwner = vehicleRegistry[_vehicleNo].ownerAddress;
        vehicleRegistry[_vehicleNo].ownerAddress = _newOwner;
        emit OwnershipTransferred(_vehicleNo, oldOwner, _newOwner);
    }

    function getVehicleOwner(string memory _vehicleNo) public view returns (address) {
        return vehicleRegistry[_vehicleNo].ownerAddress;
    }
}
